import React from 'react'
import Navbar from "./components/nav";
import { MenuProvider } from "./components/state";
import { createGlobalStyle } from "styled-components";
import reset from "styled-reset";
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import CreateUser from './components/pages/users/Createusers';
import Login from './components/pages/Login/Login';
import DashboardMain from './components/pages/Dashboard/dashboardMain';


const GlobalStyle = createGlobalStyle`
  ${reset};

  html {
    box-sizing: border-box;
  }

  body {
    font-family: "Montserrat", sans-serif;
    -webkit-font-smoothing: antialiased;
    -moz-osx-font-smoothing: grayscale;
    background-color: var(--bg);
    color: var(--text);
  }

  * {
    margin: 0;
    padding: 0;
  }

  *,
  *::before,
  *::after {
    box-sizing: inherit;
  }
  
  a {
    text-decoration: none;
  }
`;

function Routes() {
  return (
    <Router>
      <GlobalStyle />
      <MenuProvider>
        <Navbar />
      </MenuProvider>
      <Switch>
        <Route path="/CreateUser" exact component={CreateUser} />
        <Route path="/Dashboard" exact component={DashboardMain} />
      </Switch>

    </Router>
  );
}

export default Routes;
